import { useEffect, useState } from "react";
import api from "../api";

export default function Bookings() {
  const [projects, setProjects] = useState([]);
  const [houses, setHouses] = useState([]);
  const [loading, setLoading] = useState(false);

  const [form, setForm] = useState({
    projectId: "",
    houseNumber: "",
    customerName: "",
    mobileNo: "",
    paymentType: "cash",
    totalPayment: "",
    advancePayment: "",
  });

  /* ================= LOAD PROJECTS ================= */
  useEffect(() => {
    api.get("/lily").then((res) => {
      setProjects(res.data.data);
    });
  }, []);

  /* ================= PROJECT CHANGE ================= */
  const handleProjectChange = async (pid) => {
    setForm({
      ...form,
      projectId: pid,
      houseNumber: "",
      totalPayment: "",
    });

    try {
      const res = await api.get(`/lily/houses/${pid}`);

      // ✅ ONLY AVAILABLE HOUSES
      setHouses(res.data.data.filter(h => h.status === "available"));
    } catch (err) {
      console.error(err);
      setHouses([]);
    }
  };

  /* ================= HOUSE CHANGE ================= */
  const handleHouseChange = (houseNo) => {
    const selectedHouse = houses.find(h => h.houseNumber === houseNo);

    setForm({
      ...form,
      houseNumber: houseNo,
      totalPayment: selectedHouse?.price || "",
    });
  };

  /* ================= SUBMIT ================= */
  const submitBooking = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      await api.post("/bookings/create", {
        ...form,
        projectId: Number(form.projectId),
        totalPayment: Number(form.totalPayment),
        advancePayment: Number(form.advancePayment),
      });

      alert("✅ Booking Successful");

      setForm({
        projectId: "",
        houseNumber: "",
        customerName: "",
        mobileNo: "",
        paymentType: "cash",
        totalPayment: "",
        advancePayment: "",
      });

      setHouses([]);
    } catch (err) {
      alert(err.response?.data?.message || "❌ Booking Failed");
    } finally {
      setLoading(false);
    }
  };

  /* ================= UI ================= */
  return (
    <div style={{ maxWidth: 480, margin: "40px auto" }}>
      <h2>Create Booking</h2>

      <form onSubmit={submitBooking}>
        {/* PROJECT */}
        <select
          required
          value={form.projectId}
          onChange={(e) => handleProjectChange(e.target.value)}
        >
          <option value="">Select Project</option>
          {projects.map(p => (
            <option key={p.id} value={p.id}>
              {p.projectName}
            </option>
          ))}
        </select>

        {/* HOUSE */}
        <select
          required
          value={form.houseNumber}
          onChange={(e) => handleHouseChange(e.target.value)}
        >
          <option value="">Select House</option>
          {houses.map(h => (
            <option key={h.houseNumber} value={h.houseNumber}>
              {h.houseNumber}
            </option>
          ))}
        </select>

        {/* CUSTOMER */}
        <input
          required
          placeholder="Customer Name"
          value={form.customerName}
          onChange={(e) =>
            setForm({ ...form, customerName: e.target.value })
          }
        />

        <input
          required
          placeholder="Mobile Number"
          value={form.mobileNo}
          onChange={(e) =>
            setForm({ ...form, mobileNo: e.target.value })
          }
        />

        {/* PAYMENT TYPE */}
        <select
          value={form.paymentType}
          onChange={(e) =>
            setForm({ ...form, paymentType: e.target.value })
          }
        >
          <option value="cash">Cash</option>
          <option value="emi">EMI</option>
        </select>

        {/* PRICE (AUTO-FILLED) */}
        <input
          type="number"
          placeholder="Total Price"
          value={form.totalPayment}
          readOnly
        />

        {/* ADVANCE */}
        <input
          required
          type="number"
          placeholder="Advance Payment"
          value={form.advancePayment}
          onChange={(e) =>
            setForm({ ...form, advancePayment: e.target.value })
          }
        />

        <button type="submit" disabled={loading}>
          {loading ? "Booking..." : "Book House"}
        </button>
      </form>
    </div>
  );
}
